from typing import List
class Solution:
    def minCost(self, startPos: List[int], homePos: List[int], rowCosts: List[int], colCosts: List[int]) -> int:
        # no need to use fancy technique
        if startPos[0] == homePos[0] and startPos[1] == homePos[1]: return 0
        ans = 0
        x, y = startPos
        dx = 1 if homePos[0] > x else -1
        dy = 1 if homePos[1] > y else -1
        while x != homePos[0]:
            ans += rowCosts[x+dx]
            x = x+dx
        
        while y != homePos[1]:
            ans += colCosts[y+dy]
            y = y+dy
        return ans


